import React from 'react'
import {v1 as uuid} from 'uuid'

let CreateRoom= (props)=>{
    function create(){
        let id = uuid()
        props.history.push(`/room/${id}`)
    }
    return(
        <button onClick={create}>Speed Date</button>
    )
}

export default CreateRoom
